    {
      "lineNumber": 90141,
      "originalJapaneseLine": "サチコがぐいーっと引っ張る。",
      "translatedEnglishLine": "Sachiko pulls hard."
    },
    {
      "lineNumber": 90142,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90143,
      "originalJapaneseLine": "「あいた！？",
      "translatedEnglishLine": "\"Ouch!?"
    },
    {
      "lineNumber": 90144,
      "originalJapaneseLine": "　なんで叩くんですかー！」",
      "translatedEnglishLine": "Why are you hitting me?!\""
    },
    {
      "lineNumber": 90145,
      "originalJapaneseLine": "「お」",
      "translatedEnglishLine": "\"Oh\""
    },
    {
      "lineNumber": 90146,
      "originalJapaneseLine": "「おう、何してるんだ、お前ら」",
      "translatedEnglishLine": "\"Hey, what are you guys doing?\""
    },
    {
      "lineNumber": 90147,
      "originalJapaneseLine": "「あ、ランスさん。",
      "translatedEnglishLine": "\"Ah, Rance-san."
    },
    {
      "lineNumber": 90148,
      "originalJapaneseLine": "　クルックーさんに訓練してもらってるんです」",
      "translatedEnglishLine": "We're being trained by Kurukku-san.\""
    },
    {
      "lineNumber": 90149,
      "originalJapaneseLine": "「私が投げたボールを盾で受けるのです」",
      "translatedEnglishLine": "\"You catch the ball I throw with your shield.\""
    },
    {
      "lineNumber": 90150,
      "originalJapaneseLine": "「ふーん、ガード訓練ってわけだ」",
      "translatedEnglishLine": "\"Hmm, so it's guard training.\""
    },
    {
      "lineNumber": 90151,
      "originalJapaneseLine": "「……お前もこういうことするんだな」",
      "translatedEnglishLine": "\"...So you do stuff like this too.\""
    },
    {
      "lineNumber": 90152,
      "originalJapaneseLine": "「……私のことなんだと思ってます？」",
      "translatedEnglishLine": "\"...What do you think I am?\""
    },
    {
      "lineNumber": 90153,
      "originalJapaneseLine": "「しかし、面白そうな訓練だな。",
      "translatedEnglishLine": "\"But this looks like an interesting training."
    },
    {
      "lineNumber": 90154,
      "originalJapaneseLine": "　よし、俺様もやってやろう」",
      "translatedEnglishLine": "Alright, I'll give it a try too.\""
    },
    {
      "lineNumber": 90155,
      "originalJapaneseLine": "「えー……」",
      "translatedEnglishLine": "\"Ehh...\""
    },
    {
      "lineNumber": 90156,
      "originalJapaneseLine": "「なんだ」",
      "translatedEnglishLine": "\"What?\""
    },
    {
      "lineNumber": 90157,
      "originalJapaneseLine": "「だって、ランスさんの訓練って……",
      "translatedEnglishLine": "\"But, Rance-san's training is..."
    },
    {
      "lineNumber": 90158,
      "originalJapaneseLine": "　なんか乱暴そうで……」",
      "translatedEnglishLine": "kind of rough...\""
    },
    {
      "lineNumber": 90159,
      "originalJapaneseLine": "「そんなことはない。俺様は紳士だからな。",
      "translatedEnglishLine": "\"That's not true. I'm a gentleman."
    },
    {
      "lineNumber": 90160,
      "originalJapaneseLine": "　死ねーーーーッ！」",
      "translatedEnglishLine": "Dieeeee!!!\""
    },
    {
      "lineNumber": 90161,
      "originalJapaneseLine": "「ぷびえっ！？",
      "translatedEnglishLine": "\"Pbbie!?!\""
    },
    {
      "lineNumber": 90162,
      "originalJapaneseLine": "ランスの投げたボールがクリーンヒット。",
      "translatedEnglishLine": "The ball thrown by Rance landed a clean hit."
    },
    {
      "lineNumber": 90163,
      "originalJapaneseLine": "サチコはその場ですっ転んだ。",
      "translatedEnglishLine": "Sachiko fell down on the spot."
    },
    {
      "lineNumber": 90164,
      "originalJapaneseLine": "「ととと、突然なにを……！？」",
      "translatedEnglishLine": "\"W-W-What are you doing all of a sudden...!?\""
    },
    {
      "lineNumber": 90165,
      "originalJapaneseLine": "「がははは！　うりゃうりゃー！」",
      "translatedEnglishLine": "\"Gahahaha! Urya urya!\""
    },
    {
      "lineNumber": 90166,
      "originalJapaneseLine": "ランスがサチコに駆け寄り、",
      "translatedEnglishLine": "Rance rushed over to Sachiko,"
    },
    {
      "lineNumber": 90167,
      "originalJapaneseLine": "何度もボールをぶつける。",
      "translatedEnglishLine": "and threw the ball at her repeatedly."
    },
    {
      "lineNumber": 90168,
      "originalJapaneseLine": "「きゃーーーーーー！",
      "translatedEnglishLine": "\"Kyaaaaaaa!"
    },
    {
      "lineNumber": 90169,
      "originalJapaneseLine": "　いたた、やめて下さいー！」",
      "translatedEnglishLine": "Ouch, please stop!\""
    },
    {
      "lineNumber": 90170,
      "originalJapaneseLine": "「ランス、早いです」",
      "translatedEnglishLine": "\"Rance, you're too fast.\""
    },
    {
      "lineNumber": 90171,
      "originalJapaneseLine": "「なんだ、そうなのか？」",
      "translatedEnglishLine": "\"Is that so?\""
    },
    {
      "lineNumber": 90172,
      "originalJapaneseLine": "「私が『スタート』って言ったら",
      "translatedEnglishLine": "\"When I say 'start',"
    },
    {
      "lineNumber": 90173,
      "originalJapaneseLine": "　投げるんですよーッ！」",
      "translatedEnglishLine": "you throw the ball!\""
    },
    {
      "lineNumber": 90174,
      "originalJapaneseLine": "「それを先に言え」",
      "translatedEnglishLine": "\"You should have said that earlier.\""
    },
    {
      "lineNumber": 90175,
      "originalJapaneseLine": "「言う前に投げたんじゃないですかー！？」",
      "translatedEnglishLine": "\"Didn't you throw it before saying it?!\""
    },
    {
      "lineNumber": 90176,
      "originalJapaneseLine": "「えーい、ピーピーとやかましい。",
      "translatedEnglishLine": "\"Ugh, you're so noisy with your 'peep peep'."
    },
    {
      "lineNumber": 90177,
      "originalJapaneseLine": "　言うとおりにすればいいんだろ？」",
      "translatedEnglishLine": "Fine, I'll do as you say.\""
    },
    {
      "lineNumber": 90178,
      "originalJapaneseLine": "「えーっとなんと言ったら投げるんだったか」",
      "translatedEnglishLine": "\"Uh, what was the word that makes me throw?\""
    },
    {
      "lineNumber": 90179,
      "originalJapaneseLine": "「スタートって言ったら投げるんですよ」",
      "translatedEnglishLine": "\"You throw when I say 'start'.\""
