    },
    {
      "lineNumber": 90187,
      "originalJapaneseLine": "何度もボールをぶつける。",
      "translatedEnglishLine": "and threw the ball at her repeatedly."
    },
    {
      "lineNumber": 90188,
      "originalJapaneseLine": "「きゃーーーーーー！",
