    },
    {
      "lineNumber": 90189,
      "originalJapaneseLine": "　いたた、やめて下さいー！」",
      "translatedEnglishLine": "Ouch, please stop!\""
    },
    {
      "lineNumber": 90190,
      "originalJapaneseLine": "「ランス、早いです」",
      "translatedEnglishLine": "\"Rance, you're too fast.\""
    }
  ]
